  namespace: Sdl.LanguagePlatform.TranslationMemory
  summary: "\nRepresents a duplicate translation units search iterator.\n<p>After the iterator is created, it is set to start searching from the beginning of the translation memory.\nThis instance is passed to the API, which modifies it, by annotating the current position reached\nand passes it back to the caller, to be used in a subsequent call.</p>\n<p>This object should never be modified manually.</p>\n"
  syntax:
    content: 'public class DuplicateIterator : TranslationMemoryIterator'
    content.vb: >-
      Public Class DuplicateIterator

          Inherits TranslationMemoryIterator
